package strings

import (
	"testing"
)

func TestEncodeRunLength(t *testing.T) {
	for _, test := range RunLengthTestData {
		if got := EncodeRunLength(test.enc); got != test.dec {
			t.Errorf("EncodeRunLength(%s) = %s; want %s", test.enc, got, test.dec)
		}
	}
}

func TestDecodeRunLength(t *testing.T) {
	for _, test := range RunLengthTestData {
		if got := DecodeRunLength(test.dec); got != test.enc {
			t.Errorf("DecodeRunLength(%s) = %s; want %s", test.dec, got, test.enc)
		}
	}
}

